import React from "react";
import "./css/DressStyle.css";

const DressStyle = () => {
  return (
    <div className="dress-style-container">
      <h2 className="dress-style-title">BROWSE BY DRESS STYLE</h2>

    
      <div className="dress-style-row">
        <div className="dress-category casual">
        <img src="./asset/images/web-clothing/src/asset/images/Casual.png" alt="" />
          <span>Casual</span>
        </div>
        <div className="dress-category formal">
        <img src="/img/Formal.png" alt="" />
          <span>Formal</span>
        </div>
      </div>


      <div className="dress-style-row">
        <div className="dress-category party">
        <img src="/img/party.png" alt="" />
          <span>Party</span>
        </div>
        <div className="dress-category gym">
        <img src="/img/gym.png" alt="" />
          <span>Gym</span>
        </div>
      </div>
    </div>
  );
};

export default DressStyle;
